import Box from './Box'

class App extends Component{

  render(){


    const info = [   
      { name : "Ali Akbar",       img : "https://picsum.photos/251",  job : "Frontend Developer", phone : "",   email : "",   website : "myakbar.com",},
      { name : "Jason Moama",     img : "https://picsum.photos/252",  job : "Backend Developer" , phone : "+1 000 000 00",    email : "json@myJson.com",  website: "myJson.com"},
      { name : "Kazu",            img : "https://picsum.photos/254",  job : "Data Anatycs" ,      phone : "+1 043 385 00",    email : "kaz@mykaz.com",  website: "mykaz.com"},
      { name : "Johnny Deep",     img : "https://picsum.photos/252",  job : "Backend Developer" , phone : "+1 000 000 00",    email : "json@myJson.com",  website: "myJson.com"},
      { name : "Leo",             img : "https://picsum.photos/252",  job : "Backend Developer" , phone : "+1 000 000 00",    email : "json@myJson.com",  website: "myJson.com"},
      { name : "Micheal",         img : "https://picsum.photos/252",  job : "Backend Developer" , phone : "+1 000 000 00",    email : "json@myJson.com",  website: "myJson.com"},
      { name : "Robert Di Niro"   ,  img : "https://picsum.photos/252",  job : "Backend Developer" , phone : "+1 000 000 00",    email : "json@myJson.com",  website: "myJson.com"},

    ]


    const myarr = info.map((member) => {
      return <Box 
      name =    {  member.name     }
      img =     {  member.img      }
      job =     {  member.job      }
      phone =   {  member.phone    }
      email =   {  member.email    }
      website = {  member.website  }


      />
    })

    return(
      <div className='mio'>

      {myarr}

      </div>
    )
  }


}


export default App
